export enum ReactTinyLinkType {
  TYPE_AMAZON = 'TYPE_AMAZON',
  TYPE_YOUTUBE = 'TYPE_YOUTUBE',
  TYPE_AUDIO = 'TYPE_AUDIO',
  TYPE_VIDEO = 'TYPE_VIDEO',
  TYPE_IMAGE = 'TYPE_IMAGE',
  TYPE_DEFAULT = 'TYPE_DEFAULT',
  TYPE_INSTAGRAM = 'TYPE_INSTAGRAM',
  TYPE_BOARDGAMEGEEK = 'TYPE_BOARDGAMEGEEK',
  TYPE_TWITTER = "TYPE_TWITTER",
}

export type CardSizeType = 'small' | 'large'

export interface IReactTinyLinkProps {
  cardSize?: CardSizeType
  maxLine: number
  minLine: number
  url: string
  header?: string
  onError?: (error: Error) => void
  onSuccess?: (response: IReactTinyLinkData) => void
  onClick?: (e, response?: IReactTinyLinkData) => void
  description?: string
  showGraphic?: boolean
  autoPlay?: boolean
  width?: string | number
  proxyUrl?: string
  loadSecureUrl?: boolean
  scraper?: (
    url: string,
    httpClient: any,
    defaultMedia: any,
  ) => Promise<{
    title: any
    description: any
    url: any
    video: any[]
    image: any[]
    type: ReactTinyLinkType
  }>
  defaultMedia?: string
}

export interface IReactTinyLinkData {
  description: string
  image: string[]
  title: string
  type: ReactTinyLinkType
  video: string[]
  url: string
}
const REGEX_AMAZON_URL = /https?:\/\/(.*amazon\..*\/.*|.*amzn\..*\/.*|.*a\.co\/.*)/i
export const isAmazonUrl = url => REGEX_AMAZON_URL.test(url)

const REGEX_YOUTUBE = /^(https?:\/\/)?(www\.)?(youtube\.com|youtu\.?be)\/.+$/gi
export const isYoutubeUrl = url => !!url.toString().match(REGEX_YOUTUBE)

const REGEX_INSTAGRAM = /(https?:\/\/www\.)?instagram\.com(\/p\/\w+\/?)/gi
export const isInstagramUrl = url => !!url.toString().match(REGEX_INSTAGRAM)

const REGEX_BOARDGAMEGEEK = /(https?:\/\/www\.)?boardgamegeek\.com(\/boardgame\/\w+\/\w+\/?)/gi
export const isBoardGameGeekUrl = url => !!url.toString().match(REGEX_BOARDGAMEGEEK)

const REGEX_TWITTER = /(https?:\/\/(www)?\.?)?twitter\.com\/.+/gi
export const isTwitterUrl = url => !!url.toString().match(REGEX_TWITTER)

export const isEmpty = (value: any) => {
  let isEmptyObject = function(a) {
    if (typeof a.length === 'undefined') {
      // it's an Object, not an Array
      let hasNonempty = Object.keys(a).some(function nonEmpty(element) {
        return !isEmpty(a[element])
      })
      return hasNonempty ? false : isEmptyObject(Object.keys(a))
    }

    return !a.some(function nonEmpty(element) {
      // check if array is really not empty as JS thinks
      return !isEmpty(element) // at least one element should be non-empty
    })
  }
  return (
    value == false ||
    typeof value === 'undefined' ||
    value == null ||
    (typeof value === 'object' && isEmptyObject(value))
  )
}

export const isAudio = (mimeType: string) => mimeType.startsWith('audio/')
export const isVideo = (mimeType: string) => mimeType.startsWith('video/')
export const isImage = (mimeType: string) => mimeType.startsWith('image/')

// Basic Scrap Helpers
export const getTitleOfDoc = (htmlDoc: any) => {
  const titleEl = htmlDoc.querySelector('title')
  if (!titleEl) {
    return null
  }
  return titleEl.innerText
}

export const getAttrOfDocElement = (htmlDoc: any, query: string, attr: string) => {
  const el = htmlDoc.querySelector(query)
  if (!el) {
    return null
  }
  return el.getAttribute(attr)
}

export const getYoutTubeVideoId = (url: string) => {
  const parsed = url.match(/^.*((m\.)?youtu\.be\/|vi?\/|u\/\w\/|embed\/|\?vi?=|\&vi?=)([^#\&\?]*).*/)

  if (parsed && parsed[3]) {
    return parsed[3]
  } else {
    return null
  }
}

export const getInstagramVideo = (htmlDoc: any) => {
  const videoLinkMatcher = /(?:"video_url":")(.*?)(?:")/g
  if (videoLinkMatcher.test(htmlDoc)) {
    const videoMatches = videoLinkMatcher.exec(htmlDoc)
    if (videoMatches && videoMatches.length !== 0) {
      return videoMatches[0].split('":"')[1].replace('"', '')
    }
  }
  return null
}

export const fixRelativeUrls = (baseUrl: string, itemUrl: string) => {
  const normalizedUrl = itemUrl.toLocaleLowerCase()
  if (normalizedUrl.startsWith('http://') || normalizedUrl.startsWith('https://')) {
    return itemUrl
  }
  return new URL(itemUrl, baseUrl).href
}

export const getBaseUrl = (htmlDoc: any, url: string) => getAttrOfDocElement(htmlDoc, 'base', 'href') || new URL(url).origin
import { css } from 'styled-components';
import { IReactTinyLinkData, ReactTinyLinkType } from './ReactTinyLinkTypes';

const REGEX_STRIP_WWW = /^www\./;
export const media = {
  mobile: (...args) => css`
    @media (max-width: 48em) {
      ${css(...args)};
    }
  `,
  desktop: (...args) => css`
    @media (max-width: 48em) {
      ${css(...args)};
    }
  `,
};

export const getHostname = href => {
  const { hostname } = new URL(href);
  return hostname.replace(REGEX_STRIP_WWW, '');
};

export const isLarge = cardSize => cardSize === 'large';

export const isValidImageURL = src => {
  if (typeof src !== 'string') return false;
  return !!src.match(/\w+\.(a?png|gif|jpe?g|svg|webp)/gi)
}

export const isValidVideoURL = src => {
  if (typeof src !== 'string') return false;
  return !!src.match(/\w+\.(mp4|ogg|webm)/gi);
}

export const findFirstSecureUrl = (records, condition) => {
  const result = records.find(record => condition(record) && record.startsWith('https://'));
  return result ? result : '';
}

/**
 * @returns {IReactTinyLinkData} with default values.
 *
 * @param url url to fetch
 * @param defaultMedia media assigned to both the image and the video
 */
export function defaultData(url: string, defaultMedia: string[]): IReactTinyLinkData {
    return {
        title: url.substring(url.lastIndexOf('/') + 1),
        description: url.substring(url.lastIndexOf('/') + 1),
        image: defaultMedia,
        url: url,
        video: defaultMedia,
        type: ReactTinyLinkType.TYPE_DEFAULT,
    }
}

/** does nothing. Just here to have a constance reference */
export function noop() {
    return
}

/**
 * Wraps a promise to make it cancelable.
 *
 * from https://reactjs.org/blog/2015/12/16/ismounted-antipattern.html
 * defined by @istarkov at:
 * https://github.com/facebook/react/issues/5465#issuecomment-157888325
 */
