    image: !defaultMedia
      ? image.filter(i => !isEmpty(i)).map(i => fixRelativeUrls(baseUrl, i))
      : [...image, defaultMedia].filter(i => !isEmpty(i)),
    description: getAttrOfDocElement(htmlDoc, "meta[name='description']", 'content'),
