}
import { ReactTinyLinkType } from '../../ReactTinyLinkTypes'
import { isEmpty, getAttrOfDocElement, fixRelativeUrls, getBaseUrl } from '../utils'

export default async (url, data, htmlDoc, defaultMedia) => {
  const scrappedData = JSON.parse(data)
  const htmlElement = document.createElement(`html`)
  htmlElement.innerHTML = scrappedData.html

  let baseUrl = getBaseUrl(htmlDoc, url)

  const image = [
    getAttrOfDocElement(htmlDoc, "meta[property='og:image']", 'content'),
    getAttrOfDocElement(htmlDoc, "meta[property='og:image:user_generated']", 'content'),
    'https://help.twitter.com/content/dam/help-twitter/twitter-logo.png',
  ]
    .filter(i => !isEmpty(i))
    .map(i => fixRelativeUrls(baseUrl, i))

  const video = [
    getAttrOfDocElement(htmlDoc, "meta[property='og:video:url']", 'content'),
    getAttrOfDocElement(htmlDoc, "meta[property='og:video:secure_url']", 'content'),
  ]
    .filter(i => !isEmpty(i))
    .map(i => fixRelativeUrls(baseUrl, i))

  return {
    title: htmlElement.querySelector('p').textContent,
    description: scrappedData.author_name,
    url: getAttrOfDocElement(htmlDoc, "meta[property='og:url']", 'content'),
    video: video,
    image: !defaultMedia ? image : [...image, defaultMedia].filter(i => !isEmpty(i)),
    type: ReactTinyLinkType.TYPE_TWITTER, // MIME Type
    publisher: ['Twitter'],
  }
}
import * as React from 'react'
import { Media, Video } from './Card'
import { ReactTinyLinkType } from '../ReactTinyLinkTypes'
import { isValidImageURL, isValidVideoURL, findFirstSecureUrl } from '../utils'

const ImageWrapper = ({ data, secureImageUrl, loadSecureUrl }) => {
  if (loadSecureUrl && !secureImageUrl) return null
  const imageUrl = data.image && ((loadSecureUrl && secureImageUrl) ? secureImageUrl : data.image[0])

  if (!imageUrl) {
    return null
  }

  return <img
    style={{ display: `none` }}
    src={imageUrl}
    onError={(e: any) => {
      e.target.parentElement.style.filter = ''
    }}
    onLoad={(e: any) => {
      e.target.parentElement.style.filter = ''
    }}
  />

}

const VideoWrapper = ({ data, secureVideoUrl, loadSecureUrl, autoPlay }) => {
  if (loadSecureUrl && !secureVideoUrl) return null
  const videoUrl = data.video && ((loadSecureUrl && secureVideoUrl) ? secureVideoUrl : data.video[0])

  if (!videoUrl) {
    return null
  }

  return <Video
    muted
    onCanPlayThrough={e => {
      let video = e.target
      setTimeout(() => {
        video.pause()
      }, 1000)
    }}
    autoPlay={autoPlay}
    controls
  >
    <source src={`${videoUrl}#t=0.1`}></source>
  </Video>

}


const CardMedia = ({ data, cardSize, autoPlay, loadSecureUrl }) => {
  const secureImageUrl = data.image && findFirstSecureUrl(data.image, isValidImageURL)
  const secureVideoUrl = data.video && findFirstSecureUrl(data.video, isValidVideoURL)

  return (
    <>
      {data.type !== ReactTinyLinkType.TYPE_VIDEO && (
        <Media
          className="react_tinylink_card_media"
          cardSize={cardSize}
          src={data.image && (secureImageUrl ? secureImageUrl : data.image[0])}
          type={data.type}
          style={{ WebkitFilter: 'blur(10px)', filter: 'blur(10px)' }}
        >
          <ImageWrapper data={data} secureImageUrl={secureImageUrl} loadSecureUrl={loadSecureUrl} />
        </Media>
      )}
      {data.type && data.type === ReactTinyLinkType.TYPE_VIDEO && (
        <Media
          className="react_tinylink_card_media"
          cardSize={cardSize}
          src={data.video && (secureVideoUrl ? secureVideoUrl : data.video[0])}
          type={data.type}
        >
          <VideoWrapper data={data} secureVideoUrl={secureVideoUrl} autoPlay={autoPlay} loadSecureUrl={loadSecureUrl} />
        </Media>
      )}
    </>
  )
}

export default CardMedia
import { useState, useEffect } from 'react'

// Helpers
import ScraperWraper from './rules'
import { makeCancelable } from './utils'

// Types
import { IReactTinyLinkData } from './ReactTinyLinkTypes'
import { isInstagramUrl, isTwitterUrl } from './rules/utils'

/** current state of the fetch */
export interface IState<T, E> {
  /**
   * The respones to the request. Undefined if the request not done or returned
   * an error.
   */
  response: T | undefined

  /** Loading status. `true` if loading, `false` otherwise. */
  loading: boolean

  /**
   * Error status. Undefined if the request returned a valid response or is
   * loading.
   */
  error: E | undefined
}

/** array composed of:
 * 1. The respones to the request. Undefined if the request not done or returned
 *    an error.
 * 2. The loading status. `true` if loading, `false` otherwise.
 * 3. Ther error status. Undefined if the request returned a valid response or is
 *    loading.
 */
export type ResponseState<T, E> = [T | undefined, boolean, E | undefined]

export function useMountFetch(
  url: string,
  proxyUrl: string,
  /** default medias passed to the `ScraperWraper` */
  defaultMedias: string[],
  /**
   * Permits to pass a default value. This will be the response's value
   * during the loading and in case of error.
   */
  defaultValue?: IReactTinyLinkData,
  // Hooks for the caller
  /** Called when the fetch failed with the reason of the failure */
  onError?: (error: Error) => void,
  /** Called when the fetch succeeded with the resulting data */
  onSuccess?: (response: IReactTinyLinkData) => void,
): ResponseState<IReactTinyLinkData, Error> {
  // Alias to IState
  type State = IState<IReactTinyLinkData, Error>

  // Setup the state
  const [state, setState] = useState<State>({
    response: defaultValue,
    loading: true, // Avoid a re-render to set to true
    error: undefined,
  })

  /** Does the fetch on mount. Ensure the cleanup in case of premature unmounting */
  useEffect(() => {
    // Permit to control if should set the state. Avoiding a memory leak
    let isMounted: boolean = true

    // Wraps the `ScraperWraper` to manage the hook's state
    const doFetch = async (): Promise<IReactTinyLinkData> => {
      const finalStateUpdate: Partial<State> = { loading: false, error: undefined }

      try {
        // actual request to preview the link
        let client
        if (isInstagramUrl(url)) {
          const modifiedInstaUrl = `https://api.instagram.com/oembed/?url=${url}`
          client = fetch(proxyUrl ? `${proxyUrl}/${modifiedInstaUrl}` : modifiedInstaUrl, { headers })
        } else if (isTwitterUrl(url)) {
          const modifiedInstaUrl = `https://publish.twitter.com/oembed?url=${url}`
          client = fetch(proxyUrl ? `${proxyUrl}/${modifiedInstaUrl}` : modifiedInstaUrl, { headers })
        } else {
          client = fetch(proxyUrl ? `${proxyUrl}/${url}` : url, { headers })
        }

        const data = await ScraperWraper(url, client, defaultMedias)
        finalStateUpdate.response = data

        onSuccess && isMounted && onSuccess(data)
        return data
      } catch (err) {
        finalStateUpdate.error = err
        onError && isMounted && onError(err)

        return err
      } finally {
        isMounted && setState(old => ({ ...old, ...finalStateUpdate }))
      }
    }

    // Makes the request and wraps it so we can cancel it if needed
    const cancelable = makeCancelable(doFetch())

    // Returns a cleanup function which permits to avoid potential
    // memory leaks and unnecessary network when the component is
    // unmount.
    return () => {
      isMounted = false // Avoid all the state management
      cancelable.cancel() // Cancel the request
    }
  }, []) // Put no dependecy, does the fetch only once on mount

  return [state.response, state.loading, state.error]
}

/** headers passed to the fetch request */
const headers = { 'x-requested-with': '' }
